import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* Header */}
      <div className="app__header">
        <img 
          className="app__headerImage"
          src="https://instagram.com/static/images/web/mobile"
          alt=""
        />
      </div>


    </div>
  );
}

export default App;
